sys_variable_value.value:
(function execute(inputs, outputs) {

var payload2 = JSON.parse(inputs.payload2.toString());

var key = new GlideRecord('x_snc_ethsign_key');
key.addQuery('address',payload2.from.toString());
key.query();
if (key.next()) {
  outputs.key = key;
}

})(inputs, outputs);

